import React from 'react';
import styles from './index.module.css'
import Menu from './menu';

interface Skill {
    typeOfSkill: String,
    focusOfSkill: String,
    nameOfSkill: String,
}

interface MySkill {
    skill: Skill[]
}

const MySkills = ({skill}: MySkill) => {
  return (
    <section id='mySkills' className= {styles.main_mySkills}>
        <h2 className={styles.mySkills_title}>My skills</h2>
        <Menu/>
    </section>
  )
}

export default MySkills
